import React from 'react'
import { Button } from './Button'

const Persons = ( {persons, newFilter} ) => {
    return (
        <div>
            {persons.map((element, index) => {
                if (element.name.search(newFilter) !== -1) return (
                    <div key={index}>
                        <div>{element.name}
                             {element.number}
                             <Button onClick={'action'} text={'Delete'}/>
                        </div>
                    </div>
                )
                else return null
            })}
        </div>
    )
}

export { Persons }
